affinity: |
  nodeAffinity:
    requiredDuringSchedulingIgnoredDuringExecution:
      nodeSelectorTerms:
        - matchExpressions:
            - key: node.kubernetes.io/nodegroup
              operator: In
              values:
                - app

args:
  - start-dev
  - --import-realm

replicas: 2

command:
  - /opt/keycloak/bin/kc.sh

database:
  vendor: mysql
  hostname: dev.istio-demo-mysql
  port: 3306
  database: keycloak
  username: root
  password: root

extraEnv: |
  - name: KC_BOOTSTRAP_ADMIN_USERNAME
    value: admin
  - name: KC_BOOTSTRAP_ADMIN_PASSWORD
    value: admin
  - name: KC_LOG_CONSOLE_OUTPUT
    value: json
  - name: KC_PROXY
    value: edge
  - name: KC_TRACING_ENABLED
    value: "true"
  - name: KC_TRACING_ENDPOINT
    value: http://opentelemetry-collector.opentelemetry-collector.svc.cluster.local:4317
  - name: KC_TRACING_SAMPLER_TYPE
    value: parentbased_traceidratio
  - name: JAVA_OPTS_APPEND
    value: -Djgroups.dns.query=keycloak-headless.keycloak.svc.cluster.local

extraVolumes: |
  - name: keycloak-realms
    secret:
      secretName: keycloak-realms

extraVolumeMounts: |
  - name: keycloak-realms
    mountPath: /opt/keycloak/data/import

fullnameOverride: keycloak

http:
  relativePath: /

image:
  tag: 26.2.0

podAnnotations:
  traffic.sidecar.istio.io/excludeInboundPorts: "7800"
  traffic.sidecar.istio.io/excludeOutboundPorts: "7800,7801,7802,7803,7804,7805,7806,7807,7808,7809,7810"

podLabels:
  app: keycloak

resources:
  requests:
    cpu: 50m
    memory: 51Mi
  limits:
    cpu: 1000m
    memory: 1024Mi

service:
  httpPort: 8080
  httpsPort: 8443

statefulsetLabels:
  app: keycloak

secrets:
  realms:
    data:
      realm-dev.json: ''